import {Link} from "react-router-dom"

export default function Tabs() {
    return (
        <nav className="nav">
            <ul className="nav--tabs">
                <li><Link to="/">Каталог</Link></li>
                <li><Link to="/cart">Корзина</Link></li>
            </ul>
        </nav>
    )
}
